    const [products] = useState([
        {
            id: 1,
            image: '../assets/item1.jpg',
            title:'Nike Hat',
            price:'$40',
            description:'Personalized Comfort. The Nike Sportswear Pro adjustable cap sports a classic six-panel design and press-on back for a personalized fit and Comfort'
    
        },
        {
            id: 1,
            image:'',
            title:'Nike Hat',
            price:'$100',
            description:''
    
        },
        {
            id: 1,
            image:'',
            title:'Nike Hat',
            price:'$100',
            description:''
    
        }
    
     ]);
  return (
    <CardGroup>
     {products.mao((product)=> (
        <Card>
        <Card.Img variant="top" src="holder.js/100px160" />
        <Card.Body>
          <Card.Title>require{product.title}</Card.Title>
          <Card.Text>
            This is a wider card with supporting text below as a natural lead-in
            to additional content. This content is a little bit longer.
          </Card.Text>
        </Card.Body>
        <Card.Footer>
          <small className="text-muted">Last updated 3 mins ago</small>
        </Card.Footer>
      </Card>
      

        
     ))}
      
    </CardGroup>
  );
}

export default Home;
